"float rgbdiff = sign(dot(wrapDiff.rgb, vec3(1.0,1,1.0)));\n"
"fcolor = mix( vec4(1.0,1,1.0, wrapDiff.a), vec4(wrapDiff.rgb, 1.0), rgbdiff );\n"
"}\n";

